import React from "react";
import "./Left.css";

function Left(){
    return <div>
        <h1 className="left_title">Hello I'm<br/>Seohee Lee</h1>
        <h3>안녕하세요! 이석희입니다.<br/>밸런스히어로에서 Product Manager로 일하고 있구요.<br/>새로운 것을 배우는 것을 좋아합니다.</h3>
    </div>
}


export default Left;
